import './App.css';
import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import NavButtons from './NavigationButtons';
import Grid from './Grid';
import Auto from './Auto';
import './FindKeypress'
import BtnGameCtrl from './GameMode'
import ScoreBoard from './Score'
import logo from './apple.gif';
import BtnStop from './EndGame';
import GameStatus from './Game_Status'
import Obstacle from './SelectObstacle'


function App() {

  return (
    <div>
    <br></br>
      <table id='container'>
        <tr>
          <h1>Eat The Apple<span><img id="logo" src={logo} /></span></h1>
        </tr>
        <tr>
          <td id="col1">              
                <Grid/> 
          </td>
          <td id="col2">
              <div className="high_"></div>
              <div id="high_score">{window.high_score}</div>
              <ScoreBoard/>
              <NavButtons/>

              <BtnGameCtrl/>
              <Auto/><BtnStop/>

              <Obstacle/>

          </td>
        </tr>
        <tr>
        <GameStatus/>
        </tr>
      </table>

      </div>
  );
}


export default App;
